import React, { useState } from "react";
import "./loginpage.css";

const LoginPage = () => {
  const [emailValue, setEmailValue] = useState("");
  const [passwordValue, setPasswordValue] = useState("");
  const [emailError, setEmailError] = useState("");
  const [passwordError, setPasswordError] = useState("");

  const handleEmailChange = (event) => {
    setEmailValue(event.target.value);
    setEmailError("");
  };

  const handlePasswordChange = (event) => {
    setPasswordValue(event.target.value);
    setPasswordError("");
  };

  const handleFormSubmit = (event) => {
    event.preventDefault();
    if (emailValue === "") {
      setEmailError("Please enter your email address.");
    }
    if (passwordValue === "") {
      setPasswordError("Please enter your password.");
    }
    if (emailValue !== "" && passwordValue !== "") {
      // Handle form submission here
    }
  };

  return (
    <div className="login">
      <div className="left-container">
        <h1 className="logintext1">Login to Your Account</h1>
        <form onSubmit={handleFormSubmit}>
          <div className="email">
            <input
              type="email"
              id="email"
              name="email"
              placeholder="Email"
              value={emailValue}
              onChange={handleEmailChange}
            />
            <p className="error-message">{emailError}</p>
          </div>
          <div className="password">
            <input
              type="password"
              id="password"
              name="password"
              placeholder="Password"
              value={passwordValue}
              onChange={handlePasswordChange}
            />
            <p className="error-message">{passwordError}</p>
            <h6 className="forgot">Forgot Password?</h6>
            <button type="submit">Submit</button>
          </div>
        </form>
      </div>
      <div className="right-container">
        <h1 className="newhere">New Here?</h1>
        <p className="newheretext">
          Join now to discover exclusive medications and book quick appointments
          with your preferred doctors!{" "}
        </p>
        <div className="signup">
          <span>Sign Up</span>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
